class GetRequest extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            code: ""
        };
    }

    componentDidMount() {
        // Simple GET request using fetch
        fetch('https///localhost:8080/docker')
            .then(response => console.log(response.json()))
            /*
            .then(
                (response) => this.setState({
                    code: response
                })
            );
            */
    }

    render() {
        return (
            <div>
                {this.state.code}
            </div>
        );
    }
}

export default GetRequest;
